export default function NavigationPanel(props) {
  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          {props.isConnected ? (
            <>
              <Nav.Link
                href="#"
                onClick={() => props.setCurrentPage('home_page')}
                className={props.currentPage === 'home_page' ? 'active' : ''}
              >
                Accueil
              </Nav.Link>
              <Nav.Link
                href="#"
                onClick={() => props.setCurrentPage(props.myLogin)}
                className={props.currentPage === props.myLogin ? 'active' : ''}
              >
                Profil
              </Nav.Link>
              <Nav.Link
                href="#"
                onClick={() => props.setCurrentPage('edit_page')}
                className={props.currentPage === 'edit_page' ? 'active' : ''}
              >
                Editer profil
              </Nav.Link>
              <Nav.Link href="#" onClick={props.setLogout}>
                DÃ©connexion
              </Nav.Link>
            </>
          ) : (
            <>
              <Nav.Link
                href="#"
                onClick={() => props.setCurrentPage('signin_page')}
                className={props.currentPage === 'signin_page' ? 'active' : ''}
              >
                Inscription
              </Nav.Link>
              <Nav.Link
                href="#"
                onClick={() => props.setCurrentPage('login_page')}
                className={props.currentPage === 'login_page' ? 'active' : ''}
              >
                Connexion
              </Nav.Link>
            </>
          )}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}
